import React from "react";
import Course from "./Course";

const App = () => {
    const course = [
        {
            id: 1,
            name: 'Half Stack application development',
            parts: [
                {
                    name: 'Fundamentals of React',
                    exercise: 10,
                    id: 1
                },
                {
                    name: 'Using props to pass data',
                    exercise: 7,
                    id: 2
                },
                {
                    name: 'State of a component',
                    exercise: 14,
                    id: 3
                },
                {
                    name: 'Redux',
                    exercise: 11,
                    id: 4
                }
            ]
        },
        {
            name: 'Node.js',
            id: 2,
            parts: [
                {
                    name: 'Routing',
                    exercises: 3,
                    id: 1
                },
                {
                    name: 'Middlewares',
                    exercises: 7,
                    id: 2
                }
            ]
        }
    ];

    return <Course course={course} />
}

export default App;
